        <div className={theme ? "experiences" : "experiences-light"}>
            <Navigation />
            <div className="experiences-content">
                <h2>Expériences</h2>
                <hr />
                <div>
                    <ExperiencesList />
                </div>
            </div>
        </div>
    );
};

export default Experiences;
